pragma solidity ^0.8.7;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC1155/IERC1155.sol";
import "@openzeppelin/contracts/token/ERC1155/IERC1155Receiver.sol";
import "@openzeppelin/contracts/token/ERC1155/extensions/IERC1155MetadataURI.sol";
import "@openzeppelin/contracts/utils/introspection/ERC165.sol";
import "@openzeppelin/contracts/utils/math/Math.sol";
import "@openzeppelin/contracts/utils/Address.sol";
import "@openzeppelin/contracts/utils/Strings.sol";
import "./lib/ProxyRegistry.sol";

// This is largely replicating OpenZeppelin's ERC1155 - private access to owner
// mapping was needed for stashing.
contract Pixel is ERC165, IERC1155, IERC1155MetadataURI, Ownable {
    using Address for address;

    struct Fees {
        uint256 mintFee;
        uint256 mintFeeMin;
        uint256 bulkDiscount;
        uint256 colorFee;
    }

    // Max pixels allowed at this time.
    uint256 public maxPixels;

    // Pixels currently minted.
    uint256 public pixelsMinted = 0;

    // Pixel on-chain colors (may be different on web).
    uint32[] public pixelColors;

    // Mapping to owners (0 for stashed tokens).
    address[] private _pixelOwners;

    // Wyvern proxy registry address.
    address private _proxyRegistryAddress;

    // Manual proxies.
    mapping(address => mapping(address => bool)) private _operatorApprovals;

    // Base URL of API.
    string private _baseUrl;

    // A contract allowed to stash/unstash pixels (used for making blocks).
    address private _stasher = address(0);

    // Internal variables - use getMintCost instead.
    Fees private _fees;

    // Events
    event MintedPixels(uint256[] tokenIds);

    constructor(uint128 initialSize, Fees memory initialFees, string memory apiUrl, address proxyRegistryAddress) {
        require(initialFees.mintFeeMin < initialFees.mintFee, "Minimum fee cannot be greater than starting fee");
        require(initialSize % 2 == 0, "Can only set size to even numbers");
        maxPixels = initialSize * initialSize;
        _baseUrl = apiUrl;
        _fees = Fees({
            mintFee: initialFees.mintFee * 10 ** 9,
            mintFeeMin: initialFees.mintFeeMin * 10 ** 9,
            bulkDiscount: initialFees.bulkDiscount * 10 ** 9,
            colorFee: initialFees.colorFee * 10 ** 9
        });
        _proxyRegistryAddress = proxyRegistryAddress;
    }

    function supportsInterface(bytes4 interfaceId) public view virtual override(ERC165, IERC165) returns (bool) {
        return
            interfaceId == type(IERC1155).interfaceId ||
            interfaceId == type(IERC1155MetadataURI).interfaceId ||
            super.supportsInterface(interfaceId);
    }

    function uri(uint256 id) public view override returns (string memory) {
        require(id < pixelsMinted, "Pixel does not exist");
        return string(abi.encodePacked(_baseUrl, "pixel/", Strings.toString(id)));
    }

    function getColor(uint256 id) public view returns (string memory) {
        uint32 color = pixelColors[id];
        bytes memory alphabet = "0123456789abcdef";

        bytes memory str = new bytes(9);
        str[0] = '#';
        for (uint i = 8; i >= 1; i--) {
            str[i] = alphabet[color % 16];
            color >>= 4;
        }
        return string(str);
    }

    function getColors(uint256[] memory ids) public view returns (string[] memory) {
        string[] memory colors = new string[](ids.length);
        for (uint256 i = 0; i < ids.length; ++i) {
            colors[i] = getColor(ids[i]);
        }

        return colors;
    }

    function setColors(uint256[] memory ids, uint32[] memory colors) public payable {
        require(msg.value >= _fees.colorFee, "Insufficient value attached for color request.");
        require(ids.length == colors.length, "ids and colors length mismatch");
        for (uint256 i = 0; i < ids.length; ++i) {
            uint256 id = ids[i];
            uint32 color = colors[i];
            require(
                _pixelOwners[id] == msg.sender || isApprovedForAll(_pixelOwners[id], msg.sender),
                "ERC1155: caller is not owner nor approved"
            );
            pixelColors[id] = color;
        }
    }

    function balanceOf(address account, uint256 id) public view virtual override returns (uint256) {
        require(account != address(0), "ERC1155: balance query for the zero address");
        require(id < pixelsMinted, "Pixel does not exist");
        return _pixelOwners[id] == account ? 1 : 0;
    }

    function balanceOfBatch(address[] memory accounts, uint256[] memory ids)
        public
        view
        virtual
        override
        returns (uint256[] memory)
    {
        require(accounts.length == ids.length, "ERC1155: accounts and ids length mismatch");

        uint256[] memory batchBalances = new uint256[](accounts.length);

        for (uint256 i = 0; i < accounts.length; ++i) {
            batchBalances[i] = balanceOf(accounts[i], ids[i]);
        }

        return batchBalances;
    }

    function getMintCost(uint16 amount) public view returns (uint256) {
        // Total owed:
        // sum_(x=0)^amount (mintFee - bulkDiscount * x)
        // i.e. each subsequent pixel is bulkDiscount cheaper than the previous
        // one, starting at mintFee for the first one, down to mintFeeMin.
        // same as below:
        require (pixelsMinted + amount < maxPixels, "Purchase would mint more pixels than available");
        uint256 base = Math.min(amount, (_fees.mintFee-_fees.mintFeeMin)/_fees.bulkDiscount);
        return base * (_fees.mintFee - (base - 1) * _fees.bulkDiscount / 2) + (amount - base) * _fees.mintFeeMin;
    }

    function _pseudorandom() private view returns (uint256) {
        return uint256(keccak256(abi.encodePacked(blockhash(block.number - 1), block.timestamp)));
    }

    function mintTo(uint16 amount, address to) public payable {
        require (pixelsMinted + amount < maxPixels, "Cannot mint more pixels than available");
        uint256 transactionTotal = getMintCost(amount);
        require(msg.value >= transactionTotal, "Insufficient value attached for minting request");
        uint256[] memory pixelIds = new uint256[](amount);
        uint256[] memory ones = new uint256[](amount);
        uint256 random = _pseudorandom();
        for (uint16 i = 0; i < amount; i++) {
            pixelIds[i] = pixelsMinted + i;
            ones[i] = 1;
            _pixelOwners.push(to);
            pixelColors.push(uint32(random % 2 ** 32));

            // If you buy more than 255, the rest will be black /shrug
            random >>= 1;
        }
        pixelsMinted += amount;
        _doSafeBatchTransferAcceptanceCheck(msg.sender, address(0), to, pixelIds, ones, "");
        emit TransferBatch(msg.sender, address(0), to, pixelIds, ones);
        emit MintedPixels(pixelIds);
    }

    modifier onlyStasher() {
        require(_stasher == msg.sender, "Not a designated stasher.");
        _;
    }

    function stashBatch(address from, uint256[] memory pixelIds) public onlyStasher {
        uint256[] memory ones = new uint256[](pixelIds.length);
        for (uint256 i = 0; i < pixelIds.length; ++i) {
            uint256 id = pixelIds[i];

            require(_pixelOwners[id] == from, "ERC1155: insufficient balance for transfer");
            _pixelOwners[id] = address(0);
            ones[i] = 1;
        }
        emit TransferBatch(msg.sender, from, address(0), pixelIds, ones);
    }

    function unstashBatch(address to, uint256[] memory pixelIds) public onlyStasher {
        uint256[] memory ones = new uint256[](pixelIds.length);
        for (uint256 i = 0; i < pixelIds.length; i++) {
            require(pixelIds[i] < pixelsMinted, "Token does not exist");
            ones[i] = 1;
        }
        _safeBatchTransferFrom(address(0), to, pixelIds, ones, "");
    }

    function setApprovalForAll(address operator, bool approved) public virtual override {
        _setApprovalForAll(msg.sender, operator, approved);
    }

    function isApprovedForAll(address account, address operator) public view virtual override returns (bool) {
        ProxyRegistry proxyRegistry = ProxyRegistry(_proxyRegistryAddress);
        if (address(proxyRegistry.proxies(account)) == operator) {
            return true;
        }

        return _operatorApprovals[account][operator];
    }

    function safeTransferFrom(
        address from,
        address to,
        uint256 id,
        uint256 amount,
        bytes memory data
    ) public virtual override {
        require(id < pixelsMinted, "Pixel does not exist");
        require(amount == 1, "Each pixel is unique - can only transfer 1 of each.");
        require(
            from == msg.sender || isApprovedForAll(from, msg.sender),
            "ERC1155: caller is not owner nor approved"
        );
        _safeTransferFrom(from, to, id, amount, data);
    }

    function safeBatchTransferFrom(
        address from,
        address to,
        uint256[] memory ids,
        uint256[] memory amounts,
        bytes memory data
    ) public virtual override {
        require(
            from == msg.sender || isApprovedForAll(from, msg.sender),
            "ERC1155: transfer caller is not owner nor approved"
        );
        _safeBatchTransferFrom(from, to, ids, amounts, data);
    }

    function contractURI() public view returns (string memory) {
        return string(abi.encodePacked(_baseUrl, "contract"));
    }

    function _safeTransferFrom(
        address from,
        address to,
        uint256 id,
        uint256 amount,
        bytes memory data
    ) internal virtual {
        require(to != address(0), "ERC1155: transfer to the zero address");
        require(_pixelOwners[id] == from, "ERC1155: insufficient balance for transfer");

        _pixelOwners[id] = to;
        emit TransferSingle(msg.sender, from, to, id, amount);

        _doSafeTransferAcceptanceCheck(msg.sender, from, to, id, amount, data);
    }

    function _safeBatchTransferFrom(
        address from,
        address to,
        uint256[] memory ids,
        uint256[] memory amounts,
        bytes memory data
    ) internal virtual {
        require(ids.length == amounts.length, "ERC1155: ids and amounts length mismatch");
        require(to != address(0), "ERC1155: transfer to the zero address");

        uint256[] memory ones = new uint256[](ids.length);
        for (uint256 i = 0; i < ids.length; ++i) {
            uint256 id = ids[i];
            uint256 amount = amounts[i];
            require(id < pixelsMinted, "Pixel does not exist");
            require(amount == 1, "Each pixel is unique - can only transfer 1 of each.");

            require(_pixelOwners[id] == from, "ERC1155: insufficient balance for transfer");
            _pixelOwners[id] = to;
            ones[i] = 0;
        }
        emit TransferBatch(msg.sender, from, to, ids, ones);

        _doSafeBatchTransferAcceptanceCheck(msg.sender, from, to, ids, amounts, data);
    }

    function _setApprovalForAll(
        address owner,
        address operator,
        bool approved
    ) internal virtual {
        require(owner != operator, "ERC1155: setting approval status for self");
        _operatorApprovals[owner][operator] = approved;
        emit ApprovalForAll(owner, operator, approved);
    }

    function _doSafeTransferAcceptanceCheck(
        address operator,
        address from,
        address to,
        uint256 id,
        uint256 amount,
        bytes memory data
    ) private {
        if (to.isContract()) {
            try IERC1155Receiver(to).onERC1155Received(operator, from, id, amount, data) returns (bytes4 response) {
                if (response != IERC1155Receiver.onERC1155Received.selector) {
                    revert("ERC1155: ERC1155Receiver rejected tokens");
                }
            } catch Error(string memory reason) {
                revert(reason);
            } catch {
                revert("ERC1155: transfer to non ERC1155Receiver implementer");
            }
        }
    }

    function _doSafeBatchTransferAcceptanceCheck(
        address operator,
        address from,
        address to,
        uint256[] memory ids,
        uint256[] memory amounts,
        bytes memory data
    ) private {
        if (to.isContract()) {
            try IERC1155Receiver(to).onERC1155BatchReceived(operator, from, ids, amounts, data) returns (
                bytes4 response
            ) {
                if (response != IERC1155Receiver.onERC1155BatchReceived.selector) {
                    revert("ERC1155: ERC1155Receiver rejected tokens");
                }
            } catch Error(string memory reason) {
                revert(reason);
            } catch {
                revert("ERC1155: transfer to non ERC1155Receiver implementer");
            }
        }
    }

    function setFee(Fees memory newFees) public onlyOwner {
        require(newFees.mintFeeMin < newFees.mintFee, "Minimum fee cannot be greater than starting fee");
        require(newFees.colorFee < 1000000, "Color fee cannot exceed 1,000,000 gwei");
        _fees = Fees({
            mintFee: newFees.mintFee * 10 ** 9,
            mintFeeMin: newFees.mintFeeMin * 10 ** 9,
            bulkDiscount: newFees.bulkDiscount * 10 ** 9,
            colorFee: newFees.colorFee * 10 ** 9
        });
    }

    function setLimit(uint128 newSize) public onlyOwner {
        require(newSize % 2 == 0, "Can only set size to even numbers");
        uint256 newLimit = newSize * newSize;
        require(newLimit >= maxPixels, "Cannot reduce limit of pixels.");
        maxPixels = newLimit;
    }

    function setStasher(address stasherContract) public onlyOwner {
        _stasher = stasherContract;
    }
